/// <reference types="vitest/globals" />
import { Parser } from '../src'

describe('parser', () => {
  it('parses TON LSt v1 contract storage', () => {
    const pp = Parser.create(`cBC^(AC)
      24uBB
      // 24u                    // [v2-only] instant withdrawal fee
      32c                       // vali set hash
      ^(
        ^(D{256b,CC}uuCCCBC)    // curr round data
        ^(D{256b,CC}uuCCCBC)    // prev round data
      )
      CC24u
      // Cc6c                   // [v2-only]
      ^(                        // roles
        A48uA48uA
        ^(AA /* A */ /* [v2-only] sudoer */)
      )
      ^(^()^()^())              // codes`);

    const values = pp.unpack(``)

    expect(values.unpacked).toHaveLength(14)
  })

  it('parses a Hipo treasury state field (dict direct)', () => {
    const pp = Parser.create(`D*{32u,4u16u
      D{14c}
      D{32c}
      D{32c}
      D{32c}
      D{32c}
      D{32c,  // staked
      C8uCCC^(_)}
      D{32c}

      C
      C
      32c

      32u  // stakeHeldFor
      32u  // stakeHeldUntil

      }`)

    const values = pp.unpack(``)

    assert(values.unpacked.length == 1)
    expect(values.unpacked[0].direct == true)
  })

  it('parses an election contract storage', () => {
    const pp = Parser.create(`?^()      // elect, UNTESTED
      D{32c,C}  // credits
      D{        // past_elections
        i,
        uu32c          // unfreeze_at, stake_held, vset_hash
        D{32c,32cQCB}  // frozen_dict: addr, weight, staked, banned
        CC             // total_stake, bonuses
        D{32c}         // complaints
        $
      }
      C     // grams
      u     // active_id
      32c   // active_hash`)

    const values = pp.unpack('')

    assert(values.unpacked.length == 6)
    expect(values.unpacked[2].entries.every(([k, v]) => v[3].entries.length == 400)).toStrictEqual(true)
  })
})
